  selectLecture(event: any) {
    this.selectedCourseLecture = null;

    let id = event.target.options[event.target.selectedIndex].id;
    if (id) {
      this.selectedCourseLecture = this.currentCourseLectures.find(
        (value: Course, index: number): boolean => {
          if (value.id === id) {
            return true;
          }
          return false;
        }
      );
    }
  }

  selectTutorial(event) {
    this.selectedCourseTutorial = null;

    let id = event.target.options[event.target.selectedIndex].id;
    if (id) {
      this.selectedCourseTutorial = this.currentCourseTutorials.find(
        (value: Course, index: number): boolean => {
          if (value.id === id) {
            return true;
          }
          return false;
        }
      );
    }
  }

  showTime(course: string) {
    if (course.trim() === `Please Select a course...`) {
      this.error = `Please Select a proper Course to display the Lectures and Tutorials`;
      return;
    }
    this.error = ``;

    this.selectedCourseLecture = null;
    this.selectedCourseTutorial = null;

    this.currentCourseLectures = [];
    this.currentCourseTutorials = [];

    let code = course.split('-')[0];
    this.currentCourses = this.coursesGroupedByCode[code.trim()];
    this.currentCourses.forEach(course => {
      if (course.type === 'Lecture')
        return this.currentCourseLectures.push(course);
      if (course.type === 'Tutorial')
        return this.currentCourseTutorials.push(course);
    });

    this.didSelectCourse = true;
  }

  getLectureById(id: number) {
    return this.courses.find((course): boolean => {
      return course.id === id;
    });
  }

  removeCourse(event) {
    let removedLecture: Course = this.getLectureById(event.target.id);
    if (removedLecture.type === 'Lecture') {
      let lectureIndex = this[
        removedLecture.day.toLowerCase()
      ].findIndex(course => {
        return course.id === removedLecture.id;
      });

      let removedTutorial = this.timeTable.find((course): boolean => {
        return course.code === removedLecture.code;
      });

      let tutorialIndex = this[
        removedTutorial.day.toLowerCase()
      ].findIndex(course => {
        return course.id === removedTutorial.id;
      });

      if (lectureIndex !== -1) {
        this[removedLecture.day.toLowerCase()].splice(lectureIndex, 1);
        this.timeTable = this.timeTable.filter(course => {
          return course.id !== removedLecture.id;
        });
      }

      if (tutorialIndex !== -1) {
        this[removedTutorial.day.toLowerCase()].splice(tutorialIndex, 1);
        this.timeTable = this.timeTable.filter(course => {
          return course.id !== removedTutorial.id;
        });
      }

      this.error = '';
    } else {
      this.error = `Please select the lecture to remove the whole course`;
    }
  }

  addCourse() {
    if (
      this.selectedCourseLecture &&
      (this.selectedCourseTutorial || !this.currentCourseTutorials.length)
    ) {
      if (
        !this.timeTable.find((course, index) => {
          return course.code === this.selectedCourseLecture.code;
        })
      ) {
        this[this.selectedCourseLecture.day.toLowerCase()].push(
          this.selectedCourseLecture
        );
        this.timeTable.push(this.selectedCourseLecture);

        if (this.selectedCourseTutorial) {
          this[this.selectedCourseTutorial.day.toLowerCase()].push(
            this.selectedCourseTutorial
          );
          this.timeTable.push(this.selectedCourseTutorial);
        }
        this.error = '';
      } else {
        this.error = 'Please Select another Course, you already chose that.';
      }
    } else {
      this.error = 'Please Choose a proper Lecture or Tutorial';
    }
  }

  renameKeys(obj, newKeys) {
    const keyValues = Object.keys(obj).map(key => {
      const newKey = newKeys[key] || key;
      return { [newKey]: obj[key] };
    });
    return Object.assign({}, ...keyValues);
  }

  beautify() {
    let renamed = {
      Code: 'code',
      From: 'from',
      'Class Size': 'classSize',
      Date: 'date',
      Day: 'day',
      Group: 'group',
      Name: 'name',
      To: 'to',
      Status: 'status',
      Type: 'type',
      Waiting: 'waiting',
      Enrolled: 'enrolled',
      Location: 'location'
    };

    for (let i = 0; i < this.courses.length; i++) {
      Object.keys(this.courses[i]).map(key => {
        this.courses[i][key] = this.courses[i][key].replace(/[_]/g, '');
      });
      this.courses[i] = this.renameKeys(this.courses[i], renamed);

      let entry = `${this.courses[i].code} - ${this.courses[i].name}`;

      if (!this.uniqueCourses.includes(entry)) {
        this.coursesGroupedByCode[this.courses[i].code] = [];
        this.coursesGroupedByCode[this.courses[i].code].push(this.courses[i]);
        this.uniqueCourses.push(entry);
      } else {
        this.coursesGroupedByCode[this.courses[i].code].push(this.courses[i]);
      }
    }

    console.log(this.coursesGroupedByCode, 'grouped by code');
  }

